import React, { Component } from 'react';

class Boarding extends Component {
    render() {
        return (
            <div>
                <h1>Boarding</h1>
                <div>
                    Here at Zinky's, we treat your furbabies like we would our own, we like every pet to feel like family! With that being said, we don't kennel our boarding visitors all day. In fact, we board them the least amount of time possible. While we do have dsesignated naptime and bedtime, other than that, your beloved pet will be running free and playing with other pups on their visit with us. We have naptime so our visitors don't get overstimulated and we akso use this as a time for their morninf meal.
                </div>
            </div>

        );
    }
}

export default Boarding;
